css:
.open-in-browsers span:hover {
  color: green;
  font-size: large;
}
.open-in-browsers span {
  padding: 5px 10px;
}
.open-in-browsers span.selected {
  background-color: #105a6b;
  border: 1px solid black;
}
@font-face {
  font-family: "FontAwesome";
  font-style: normal;
  font-weight: normal;
  src: url(atom://open-in-browsers/resources/fonts/fontawesome-webfont.woff) format('woff');
}
.fa {
  font-family: "FontAwesome";
  display: inline-block;
  font: normal normal normal 14px/1 FontAwesome;
  font-size: inherit;
  text-rendering: auto;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
}
.browser-plus-icon::before {
  font-family: "Octicons Regular";
  content: "\f0c5";
}
.Safari::before,
.SafariPortable::before {
